import {BrowserRouter as Router,Route,Routes} from 'react-router-dom'
import './App.css';
import NavBar from './components/navBar';
function App() {
  return (
    <div className="App">
    <Router>
      <NavBar/>
      <Routes>
        <Route path='/'/>
        <Route path='/cart'/>
      </Routes>
    </Router>
    </div>
  );
}

export default App;
